import React from "react";
import { Link } from "react-router-dom";

const PhotoDetail = ({ photo }) => (
    <div>
        <Link to="/photos">Go to gallery</Link>
        <img alt={`Detail ${photo.id}`} src={photo.url} />
    </div>
);

export default PhotoDetail;
